import React from 'react'
import Navbar from './Navbar'

const compStyle = {
    header:{
        color:"#fff"
    }
}

const Header = () => {
   
    return (
        <>
             <header className="container-fluid px-5 py-4 " style={{backgroundImage: "url(../img/HeaderBg.svg"}}>
               <Navbar />
               <h2 className={compStyle.header}>Hello</h2>
             </header>
        </>
    )
}

export default Header
